import SpotifyPlayer from 'react-spotify-player';

const player = `
<SpotifyPlayer
  uri="spotify:album:1TIUsv8qmYLpBEhvmBmyBk"
  size={{
    width: '100%',
    height: 300,
  }}
  view={'list'}
  theme={'black'}
/>
`;
export default player;
